        background: "#0eacb3",
        color: "white",
        fontSize: "12px",
        fontWeight: "400",
      };
    const cellStyle2 = {
        border: "0.3px solid white",
        padding: "8px",
        background: "#75d0d4",
        color: "white",
        fontSize: "13px",
        fontWeight: "300",
      };
    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    return(
        <>
      <button className="Form_Button" onClick={handleShow}>
        <ion-icon name="reader" />
      </button>
      <Modal show={show} onHide={handleClose} size="xl">
        <Modal.Body>
        <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <table style={{ border: "0.3px solid gray", background: "#f2f1f1" }}>
            <tr>
                <td style={cellStyle1}>

                </td>
                <td style={cellStyle2}>

                </td>
            </tr>
                
            </table>
            <table style={{ border: "0.3px solid gray", background: "#f2f1f1" }}>
            <tr>
                <td style={cellStyle1}>
                    sdfsdfedfedd

                </td>
                <td style={cellStyle2}>
                    svsdfvdfsfvs

                </td>
            </tr>
                
            </table>
        </Modal.Body>
        
        
        </Modal></>
    );
      
}

export default RakeForm;
